<template>
  <button type="button" class="btn btn-primary" @click="router.push('/abb')">
    ページ遷移dayo</button
  ><br />
  <button type="button" class="btn btn-primary" @click="clickDraw">作図</button
  ><br />
  <button type="button" class="btn btn-primary" @click="clickStartSensor">
    センサーを有効にする</button
  ><br />
  <LineChart :chart-data="chartData" />
  <!-- <LineChart :chart-data="chartAcceleration" /> -->
  <GBowl :x="adjust_g_x" :y="adjust_g_y" :draw="draw" />

  <!-- gyro_z -->
  <div class="row">
    <div class="col">
      <div class="form-floating">
        <input
          id="inputGyroX"
          v-model="gyro_z"
          type="text"
          class="form-control"
        />
        <label for="inputGyroX">gyro_z</label>
      </div>
    </div>
  </div>
  <!-- gyro_y -->
  <div class="row">
    <div class="col">
      <div class="form-floating">
        <input
          id="inputGyroX"
          v-model="gyro_y"
          type="text"
          class="form-control"
        />
        <label for="inputGyroX">gyro_y</label>
      </div>
    </div>
  </div>
  <!-- gyro_x -->
  <div class="row">
    <div class="col">
      <div class="form-floating">
        <input
          id="inputGyroX"
          v-model="gyro_x"
          type="text"
          class="form-control"
        />
        <label for="inputGyroX">gyro_x</label>
      </div>
    </div>
  </div>

  <br />
  <!-- acceleration_x -->
  <div class="row">
    <div class="col">
      <div class="form-floating">
        <input
          id="inputGyroX"
          v-model="acceleration_x"
          type="text"
          class="form-control"
        />
        <label for="inputGyroX">acceleration_x</label>
      </div>
    </div>
  </div>

  <!-- acceleration_y -->
  <div class="row">
    <div class="col">
      <div class="form-floating">
        <input
          id="floatingInputGrid"
          v-model="acceleration_y"
          type="email"
          class="form-control"
          placeholder="name@example.com"
        />
        <label for="floatingInputGrid">acceleration_y</label>
      </div>
    </div>
  </div>
  <!-- acceleration_z -->
  <div class="row">
    <div class="col">
      <div class="form-floating">
        <input
          id="floatingInputGrid"
          v-model="acceleration_z"
          type="email"
          class="form-control"
          placeholder="name@example.com"
        />
        <label for="floatingInputGrid">acceleration_z</label>
      </div>
    </div>
  </div>
  <br />
  <!-- G_X -->
  <div class="row">
    <div class="col">
      <div class="form-floating">
        <input
          id="inputGyroX"
          v-model="adjust_g_x"
          type="text"
          class="form-control"
        />
        <label for="inputGyroX">x</label>
      </div>
    </div>
  </div>
  <!-- G_Y -->
  <div class="row">
    <div class="col">
      <div class="form-floating">
        <input
          id="floatingInputGrid"
          v-model="adjust_g_y"
          type="email"
          class="form-control"
          placeholder="name@example.com"
        />
        <label for="floatingInputGrid">y</label>
      </div>
    </div>
  </div>
  <!-- angle_g_xy -->
  <div class="row">
    <div class="col">
      <div class="form-floating">
        <input
          id="floatingInputGrid"
          v-model="angle_g_xy"
          type="email"
          class="form-control"
          placeholder="name@example.com"
        />
        <label for="floatingInputGrid">angle_g_xy</label>
      </div>
    </div>
  </div>
</template>

<script lang="ts">
import { defineComponent, ref, reactive, inject } from 'vue'
import { useRouter } from 'vue-router'
import {
  useAccelerationSensortKey,
  useAccelerationSensortType,
} from '@/libs/device/accelerationSensor'

import { useGyroSensortKey, useGyroSensortType } from '@/libs/device/gyroSensor'

import { pointToAtan2 } from '@/libs/trigonometric'

import GBowl from '@/components/GBowl.vue'
import LineChart from '@/components/chart/LineChart'
// import { max_g } from '@/libs/constants'
// import { useDeviceKey, useDeviceType } from '@/libs/device/device'

import { BigNumber } from 'bignumber.js'

export default defineComponent({
  components: {
    GBowl,
    LineChart,
  },
  setup() {
    const router = useRouter()

    // ジャイロセンサーのモジュール
    const useGyroSensor = inject(useGyroSensortKey) as useGyroSensortType

    // 加速度センサーのモジュール
    const useAccelerationSensor = inject(
      useAccelerationSensortKey
    ) as useAccelerationSensortType

    // BigNumberの初期設定
    BigNumber.config({
      DECIMAL_PLACES: 4, // 小数部2桁
      ROUNDING_MODE: BigNumber.ROUND_DOWN, // 切り上げ})
    })

    // 音声(G)
    // const jG01 =
    //   'data:audio/mp3;base64,'
    const jG02 =
      'data:audio/mp3;base64,'
    const jG03 =
      'data:audio/mp3;base64,'
    const jG04 =
      'data:audio/mp3;base64,'
    const jG05 =
      'data:audio/mp3;base64,'
    const jG06 =
      'data:audio/mp3;base64,'
    const jG07 =
      'data:audio/mp3;base64,'
    const jG08 =
      'data:audio/mp3;base64,'
    const jG09 =
      'data:audio/mp3;base64,'
    const jG10 =
      'data:audio/mp3;base64,'
    const jG11 =
      'data:audio/mp3;base64,'
    const jG12 =
      'data:audio/mp3;base64,'

    // // 音声(Gの向き)
    // const jT1 =
    //   'data:audio/mp3;base64,'
    // const jT2 =
    //   'data:audio/mp3;base64,'
    // const jT3 =
    //   'data:audio/mp3;base64,'
    // const jT4 =
    //   'data:audio/mp3;base64,'
    // const jT5 =
    //   'data:audio/mp3;base64,'
    // const jT6 =
    //   'data:audio/mp3;base64,'
    // const jT7 =
    //   'data:audio/mp3;base64,'
    // const jT8 =
    //   'data:audio/mp3;base64,'
    // const jT9 =
    //   'data:audio/mp3;base64,'
    // const jT10 =
    //   'data:audio/mp3;base64,'
    // const jT11 =
    //   'data:audio/mp3;base64,'
    // const jT12 =
    //   'data:audio/mp3;base64,'

    // gサークルを描画するかどうかのフラグ
    const draw = ref(false)
    // 調整済のGの値
    const adjust_g_x = ref(0)
    const adjust_g_y = ref(0)
    // 直前のgの値(ローパスフィルタで使用)
    let before_g_x = 0
    let before_g_y = 0
    // x軸とy軸のGの積の角度
    const angle_g_xy = ref(0)

    // 加速度の値
    const acceleration_x = ref(0)
    const acceleration_y = ref(0)
    const acceleration_z = ref(0)

    // ジャイロの値
    const gyro_z = ref(0)
    const gyro_y = ref(0)
    const gyro_x = ref(0)

    // 加速度センサーのチャートデータ
    const chartData = reactive({
      labels: [] as string[],
      datasets: [
        {
          label: 'x',
          backgroundColor: '#f87979',
          borderColor: '#f87979',
          data: [] as number[],
          fill: false,
          tension: 0.2,
        },
        {
          label: 'y',
          backgroundColor: '#0d6efd',
          borderColor: '#0d6efd',
          data: [] as number[],
          fill: false,
          tension: 0.2,
        },
        {
          label: 'z',
          backgroundColor: '#777777',
          borderColor: '#777777',
          data: [] as number[],
          fill: false,
          tension: 0.2,
        },
      ],
    })
    const acceleration_x_log = [] as number[]
    const acceleration_y_log = [] as number[]
    const acceleration_z_log = [] as number[]

    // 加速度センサーから値が取得できた時に呼ばれるイベント処理
    const deviceAcceleration = (e: DeviceMotionEvent) => {
      // 加速度センサーが有効になっているかどうかのチェック
      if (!useAccelerationSensor.stateRefs.isEnable.value) return
      // 加速度取得
      const acceleration = e.accelerationIncludingGravity
      if (acceleration === null) return
      const e_acceleration_x = acceleration.x ?? 0
      const e_acceleration_y = acceleration.y ?? 0
      const e_acceleration_z = acceleration.z ?? 0

      // 加速度をGに変換
      const g_x = e_acceleration_x / 9.8
      const g_y = e_acceleration_y / 9.8

      // ローパスフィルタでのノイズ削除
      adjust_g_x.value = useAccelerationSensor.filter(before_g_x, g_x).LPF()
      adjust_g_y.value = useAccelerationSensor.filter(before_g_y, g_y).LPF()
      before_g_x = g_x
      before_g_y = g_y

      // Gの角度を算出
      angle_g_xy.value = pointToAtan2({ x: g_x, y: g_y }) + 3

      //const acceleration_interval = e.interval
      acceleration_x.value = e_acceleration_x
      acceleration_y.value = e_acceleration_y
      acceleration_z.value = e_acceleration_z

      acceleration_x_log.push(e_acceleration_x)
      acceleration_y_log.push(e_acceleration_y)
      acceleration_z_log.push(e_acceleration_z)
    }

    // ジャイロセンサーから値が取得できた時に呼ばれるイベント処理
    const deviceGyro = (e: DeviceOrientationEvent) => {
      // ジャイロセンサーが有効になっているかどうかのチェック
      if (!useGyroSensor.stateRefs.isEnable.value) return
      if (e.alpha === null || e.beta === null || e.gamma === null) return

      gyro_z.value = e.alpha
      gyro_y.value = e.beta
      gyro_x.value = e.gamma
    }

    // スマホセンサーの加速度を車体に合わせて回転させる
    const changeCarG = () => {
      /**
       * 3次元ベクトルを回転させる。
       */
      const rotate = (
        v: number[][],
        b: number[]
      ): {
        x: number
        y: number
        z: number
      } => {
        return {
          x:
            new BigNumber(v[0][0]).times(b[0]).toNumber() +
            new BigNumber(v[0][1]).times(b[1]).toNumber() +
            new BigNumber(v[0][2]).times(b[2]).toNumber(),
          y:
            new BigNumber(v[1][0]).times(b[0]).toNumber() +
            new BigNumber(v[1][1]).times(b[1]).toNumber() +
            new BigNumber(v[1][2]).times(b[2]).toNumber(),
          z:
            new BigNumber(v[2][0]).times(b[0]).toNumber() +
            new BigNumber(v[2][1]).times(b[1]).toNumber() +
            new BigNumber(v[2][2]).times(b[2]).toNumber(),
        }
      }

      // 回転方向(度)
      const rotate_x = 2
      const rotate_y = 3
      const rotate_z = 4
      // 角度→ラジアンに変換
      const radian_z = new BigNumber(rotate_z)
        .times(new BigNumber(Math.PI).div(180))
        .toNumber()
      const razian_y = new BigNumber(rotate_y)
        .times(new BigNumber(Math.PI).div(180).toNumber())
        .toNumber()
      const razian_x = new BigNumber(rotate_x)
        .times(new BigNumber(Math.PI).div(180).toNumber())
        .toNumber()

      // 回転させる対象の座標
      const point = { x: 1, y: 2, z: 3 }

      // x軸周りにθ回転した座標を取得する表現行列
      const matrix_x = [
        [1, 0, 0],
        [0, Math.cos(razian_x), -Math.sin(razian_x)],
        [0, Math.sin(razian_x), Math.cos(razian_x)],
      ]

      // y軸周りにθ回転した座標を取得する表現行列
      const matrix_y = [
        [Math.cos(razian_y), 0, Math.sin(razian_y)],
        [0, 1, 0],
        [-Math.sin(razian_y), 0, Math.cos(razian_y)],
      ]

      // z軸周りにθ回転した座標を取得する表現行列
      const matrix_z = [
        [Math.cos(radian_z), -Math.sin(radian_z), 0],
        [Math.sin(radian_z), Math.cos(radian_z), 0],
        [0, 0, 1],
      ]

      // x軸の回転
      let result = rotate(matrix_x, [point.x, point.y, point.z])
      // alert(
      //   `x:${result.x} y:${result.y} z:${result.z}
      //   `
      // )
      // y軸の回転
      result = rotate(matrix_y, [result.x, result.y, result.z])
      // alert(
      //   `x:${result.x} y:${result.y} z:${result.z}
      //   `
      // )
      // z軸の回転
      result = rotate(matrix_z, [result.x, result.y, result.z])
      // alert(
      //   `x:${result.x} y:${result.y} z:${result.z}
      //   `
      // )
      alert(
        `angle(ラジアン) \n
        x: ${razian_x} y:${razian_y} z:${radian_z} \n
        angle(角度) \n
        x: ${rotate_x} y:${rotate_y} z:${rotate_z} \n
        before \n
        x:${point.x} y:${point.y} z:${point.z} \n
        after \n
        x:${result.x} y:${result.y} z:${result.z}
        `
      )
    }

    // 「センサーを有効」押下
    const clickStartSensor = () => {
      // 加速度センサーの有効化
      useAccelerationSensor.addEvent(deviceAcceleration)
      useAccelerationSensor.enableSensor()
      // ジャイロセンサーの有効化
      useGyroSensor.addEvent(deviceGyro)
      useGyroSensor.enableSensor()
    }

    // 「作図」押下
    const clickDraw = () => {
      // LineChart
      chartData.labels = [...Array(acceleration_x_log.length)].map(() => '')
      chartData.datasets[0].data = acceleration_x_log
      chartData.datasets[1].data = acceleration_y_log
      chartData.datasets[2].data = acceleration_z_log

      changeCarG()

      draw.value = true
      //const music_03G01 = new Audio(jG01)
      const music_03G02 = new Audio(jG02)
      const music_03G03 = new Audio(jG03)
      const music_03G04 = new Audio(jG04)
      const music_03G05 = new Audio(jG05)
      const music_03G06 = new Audio(jG06)
      const music_03G07 = new Audio(jG07)
      const music_03G08 = new Audio(jG08)
      const music_03G09 = new Audio(jG09)
      const music_03G10 = new Audio(jG10)
      const music_03G11 = new Audio(jG11)
      const music_03G12 = new Audio(jG12)

      // 音声出力に関する処理
      setInterval(() => {
        const g_xy =
          Math.ceil(
            Math.sqrt(adjust_g_x.value ** 2 + adjust_g_y.value ** 2) * 10
          ) / 10

        const round_g_xy = Math.round(g_xy * 10) / 10
        // const angle_time = Math.round(Math.round(angle_g_xy.value / 30))

        switch (round_g_xy) {
          case 0.1:
            return
          case 0.2:
            music_03G02.play()
            break
          case 0.3:
            music_03G03.play()
            break
          case 0.4:
            music_03G04.play()
            break
          case 0.5:
            music_03G05.play()
            break
          case 0.6:
            music_03G06.play()
            break
          case 0.7:
            music_03G07.play()
            break
          case 0.8:
            music_03G08.play()
            break
          case 0.9:
            music_03G09.play()
            break
          case 1:
            music_03G10.play()
            break
          case 1.1:
            music_03G11.play()
            break
          case 1.2:
            music_03G12.play()

            break
        }
      }, 500)
    }

    return {
      clickDraw,
      clickStartSensor,
      router,
      draw,
      adjust_g_x,
      adjust_g_y,
      angle_g_xy,
      gyro_z,
      gyro_y,
      gyro_x,
      acceleration_x,
      acceleration_y,
      acceleration_z,
      chartData,
    }
  },
  computed: {},
})
</script>
